Colombiana (2011)
PG-13 | 108 min | Action, Crime, Drama | 26 August 2011 (USA)

In 1992 Bogota, a little girl (Amandla Stenberg) watches crime lord Don Luis (Beto Benites) and his henchman Marco (Jordi MollÃƒÂ ) murder her parents. Fifteen years later, the now-grown Cataleya (Zoe Saldana), who is named for a Colombian orchid, works as a contract killer for her Chicago-based uncle (Cliff Curtis). Leaving a lipstick drawing of her namesake on every victim, Cataleya carries out her assignments with cold, frightening efficiency and dreams of avenging her family.

Stars: Zoe Saldana, Michael Vartan, Callum Blue


